import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { User, Mail, CalendarDays, Award, ArrowLeft, Edit } from 'lucide-react';
import ConsistencyContext from '../context/ConsistencyContext';
import Card from '../components/ui/Card';
import LoadingState from '../components/LoadingState';
import { getScoreInfo } from '../utils/helpers';

const ProfilePage = () => {
  const { userProfile, score, loading } = useContext(ConsistencyContext);
  const { level: currentLevel, color: levelColor } = getScoreInfo(score); // Get level and color

  const pageVariants = {
    initial: { opacity: 0, y: 20 },
    in: { opacity: 1, y: 0 },
    out: { opacity: 0, y: -20 }
  };

  const transition = { duration: 0.4, ease: 'easeInOut' };

  return (
    <motion.div
      initial="initial"
      animate="in"
      exit="out"
      variants={pageVariants}
      transition={transition}
      className="container mx-auto px-4 py-8"
    >
      <div className="mb-6">
        <Link to="/" className="inline-flex items-center text-indigo-600 hover:text-indigo-800 transition-colors group">
           <ArrowLeft size={18} className="mr-1 group-hover:-translate-x-1 transition-transform" />
           Back to Dashboard
        </Link>
      </div>

      <h1 className="flex items-center text-3xl font-bold text-gray-800 mb-8">
        <User className="mr-3 text-indigo-600" size={32}/>
        Your Profile
      </h1>

      {loading ? (
         <Card className="flex items-center justify-center min-h-[200px]">
            <LoadingState />
         </Card>
      ) : (
        <Card className="p-6 md:p-8">
            <div className="flex flex-col md:flex-row items-center justify-between mb-6 border-b pb-4">
                 <div className="flex items-center mb-4 md:mb-0">
                    {/* Placeholder for profile picture */}
                    <div className="w-20 h-20 bg-indigo-100 rounded-full flex items-center justify-center mr-4">
                       <User size={40} className="text-indigo-400" />
                    </div>
                    <div>
                       <h2 className="text-2xl font-semibold text-gray-900">{userProfile.name}</h2>
                       <p className="text-gray-500">{userProfile.email}</p>
                    </div>
                 </div>
                 <button className="flex items-center text-sm text-indigo-600 hover:text-indigo-800 transition-colors font-medium">
                    <Edit size={16} className="mr-1" /> Edit Profile (Soon)
                 </button>
            </div>

           <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
               {/* Profile Details */}
                <div className="space-y-4">
                    <div className="flex items-center">
                        <Mail size={20} className="text-gray-500 mr-3" />
                        <span className="text-gray-700"><strong>Email:</strong> {userProfile.email}</span>
                    </div>
                    <div className="flex items-center">
                        <CalendarDays size={20} className="text-gray-500 mr-3" />
                        <span className="text-gray-700"><strong>Joined:</strong> {userProfile.joinDate}</span>
                    </div>
                    <div className="flex items-center">
                        <Award size={20} className={`${levelColor} mr-3`} />
                        <span className="text-gray-700">
                            <strong>Current Level:</strong> <span className={`font-semibold ${levelColor}`}>{currentLevel}</span> (Based on score: {score})
                        </span>
                    </div>
                </div>

                {/* Placeholder for more stats or settings */}
                <div className="bg-gray-50 p-4 rounded-md border">
                    <h4 className="font-semibold text-gray-800 mb-2">Account Settings</h4>
                    <p className="text-sm text-gray-600">Password changes and notification preferences will appear here.</p>
                    {/* Add placeholder buttons or links later */}
                </div>
           </div>
        </Card>
      )}
    </motion.div>
  );
};

export default ProfilePage;
